import { InputContainer } from 'components/common/styled';
import React from 'react';
import { useDispatch } from 'react-redux';
import { setLoginModalInvisible } from 'store/action/LoginAction';
import styled from 'styled-components';

function Signin() {
	const dispatch = useDispatch();
	const handleLoginModalInvisible = () => {
		dispatch(setLoginModalInvisible());
	};

	return (
		<ComponetsWrapper>
			<div className="modal-header-wrapper">
				회원가입
				<button
					type="button"
					onClick={() => handleLoginModalInvisible()}
				>
					<svg
						width="24"
						height="24"
						viewBox="0 0 24 24"
						color="#999"
					>
						<path
							fill="currentColor"
							d="M17.97 19.03a.75.75 0 001.06-1.06l-6.5-6.5a.75.75 0 00-1.06 0l-6.5 6.5a.75.75 0 001.06 1.06L12 13.06l5.97 5.97zM12 10.94L6.03 4.97a.75.75 0 00-1.06 1.06l6.5 6.5a.75.75 0 001.06 0l6.5-6.5a.75.75 0 00-1.06-1.06L12 10.94z"
						/>
					</svg>
				</button>
			</div>
			<div className="modal-content-wrapper">
				<div className="modal-emailinput-wrapper">
					<p>이메일</p>
					<div>
						<InputContainer
							type="text"
							placeholder="이름을 입력해 주세요."
							id="text"
						/>
					</div>
				</div>
				<div className="modal-emailinput-wrapper">
					<p>휴대폰 번호</p>
					<div>
						<div className="box-mobileinput-wrapper">
							<span>대한민국 +82</span>
						</div>
					</div>
				</div>
			</div>
		</ComponetsWrapper>
	);
}

const ComponetsWrapper = styled.div`
	.modal-emailinput-wrapper {
		position: relative;
		padding-bottom: 22px;
		color: #767676;
	}
	.box-mobileinput-wrapper {
		margin-bottom: 10px;
		position: relative;
		flex: 1 1;
		line-height: 50px;
		padding: 0 15px;
		height: 50px;
		font-size: 15px;
		border-radius: 5px;
		border: 1px solid #e1e2e3;
		color: #333;
	}
`;

export default Signin;
